class Hitterknn:  
    def __init__(self, k, inputlst):
        self.k = k 
        self.outData = []
        tmp = []
        for i in range(5):
            num = float(inputlst[i]-hMin[i])
            num /= hMax[i]-hMin[i]
            tmp.append(num)
        self.inputData = tmp
    def calDist(self):
        for i in range(174): 
            res = float(0) 
            for t in range(5):
                res += (float(hitterInput[i][t])-float(self.inputData[t]))**2
            res = res**(1/2) 
            lst = [res, int(hitterOutput[i])] 
            self.outData.append(lst) 
    def obtainVote(self):
        self.outData.sort(key=lambda x:x[0])
        sum = int(0)
        for i in range(self.k):
            sum += self.outData[i][1]
        print(int(sum/self.k))
        
